import React from "react";
import { useState } from "react";

const Products = (props) => {
  const [locator, setLocator] = useState([]);

  return (
    // <div className=" h-screen flex justify-center items-center bg-yellow-300">
    //   <h1 className="text-9xt uppercase font-black">Products</h1>
    <>
      {/* <div className="search">
        <input type="text" placeholder="Search..." />
      </div> */}
      <div className="h-full rounded mb-50 shadow">
        locator={locator}
        {props.locator.map((locator) => {
          return (
            <div
              className="flex flex-1 flex-col items-center lg:items-center"
              key={locator.id}
            >
              <h4 className="flex flex-1 flex-col items-center lg:items-cente">
                Name: {locator.name}
              </h4>
              {/* <h5>image: {locator.image}</h5> */}
              <h5 className="flex flex-1 flex-col items-center lg:items-cente">
                price: {locator.price}
              </h5>
            </div>
          );
        })}
      </div>
    </>
  );
};

export default Products;
